    """
    In this problem, we construct a graph,
    where each node is a segment and each edge is the intersection of two segments.

    Then we find the shortest path from the source to the sink.

    The minimum number of hops from the source to the sink is the maximum length of the shortest path.
    """

    # input parameters
    n = int(stdin)
    segments = [tuple(map(int, line.split(' '))) for line in stdin.split('\n')[:n]]

    # construct the graph
    graph = {}
    for s, e in segments:
        if s in graph:
            graph[s].append(e)
        else:
            graph[s] = [e]
        if e in graph:
            graph[e].append(s)
        else:
            graph[e] = [s]

    # get the source and sink
    sink = list(graph.keys())[-1]
    source = list(graph.keys())[0]

    # BFS
    queue = [source]
    dist = {source: 0}

    while queue:
        node = queue.pop(0)
        if node == sink:
            break
        for next_node in graph[node]:
            if next_node not in dist:
                queue.append(next_node)
                dist[next_node] = dist[node] + 1

    return max(dist.values())


