class CupCircle:
    def __init__(self, values):
        self.current = Cup(values[0], 0)
        self.max_value = values[0]
        for value in values[1:]:
            cup = Cup(value, self.max_value + 1)
            self.current.next = cup
            self.max_value = cup.value
            self.current = cup

    def __iter__(self):
        return self.current

    def __str__(self):
        lst = list()
        for cup in self:
            lst.append(cup.value)
        return str(lst)

    def pick(self, index):
        current = self.current
        current_index = 0
        while current_index!= index:
            current = current.next
            current_index += 1
        result = current.value
        current.next = current.next.next
        current = current.next
        self.current = current
        return result

    def insert(self, value):
        new_cup = Cup(value, self.max_value + 1)
        self.current.next = new_cup
        self.max_value = new_cup.value
        self.current = new_cup

    def __len__(self):
