    """Vova's family is building the Great Vova Wall (named by Vova himself).
    Vova's parents, grandparents, grand-grandparents contributed to it.
    Now it's totally up to Vova to put the finishing touches.

    The current state of the wall can be respresented by a sequence $a$ of $n$ integers,
    with $a_i$ being the height of the $i$-th part of the wall.

    Vova can only use $2 \times 1$ bricks to put in the wall (he has infinite supply of them,
    however).

    Vova can put bricks horizontally on the neighboring parts of the wall of equal height.
    It means that if for some $i$ the current height of part $i$ is the same as for part $i + 1$,
    then Vova can put a brick there and thus increase both heights by 1. Obviously, Vova can't
    put bricks in such a way that its parts turn out to be off the borders (to the left of part $1$
    of the wall or to the right of part $n$ of it).

    The next paragraph is specific to the version 1 of the problem.

    Vova can also put bricks vertically. That means increasing height of any part of the wall by 2.

    Vova is a perfectionist, so he considers the wall completed when:

    all parts of the wall has the same height;  the wall has no empty spaces inside it.

    Can Vova complete the wall using any amount of bricks (possibly zero)?

    :param stdin: input
    :return: solution string
    """
    n = int(stdin)
    a = [int(x) for x in stdin.split()]
    if n == 1:
        return "YES" if a[0] == 1 else "NO"
    d = {}
    for i in a:
        d[i] = d.get(i, 0) + 1
    for i in d:
        if d[i] == 0:
            return "NO"
    if min(a) == 1 and max(a) == n:
        return "YES"
    d = {}
    for i in range(n):
        if a[i] not in d:
            d[a[i]] = 1
        else:
            d[a[i]] += 1
    for i in d:
        if d[i] == 1:
            return "NO"
    for i in range(n):
        if a[i] - 1 not in d:
            return "NO"
        if a[i] + 1 not in d:
            return "NO"
        if d[a[i] - 1] <= 2 and d[a[i] + 1] <= 2:
            return "NO"
    return "YES"

