def solution(stdin: str) -> str:
    # get number of rows and columns from first line of stdin
    rows, cols = [int(x) for x in stdin.split('\n')[0].split(' ')]
    # store entries in a 2d array
    entries = [int(x) for x in stdin.split('\n')[1:]]
    # create a matrix
    matrix = [[0 for _ in range(cols)] for _ in range(rows)]
    # fill the matrix with entries
    for row in range(rows):
        for col in range(cols):
            matrix[row][col] = entries[row * cols + col]
    # perform the shift operations
    for col in range(cols):
        # shift column up
        for row in range(1, rows):
            matrix[row][col] = matrix[row - 1][col]
        # set the entry at the first row to 0
        matrix[0][col] = 0
    # calculate the difference between the original and the resulting matrix
    # note: this is the number of operations required to obtain the good matrix
    diff = 0
    for row in range(rows):
        for col in range(cols):
            diff += abs(matrix[row][col] - (row * cols + col))
    return str(diff)

print(solution(stdin))

def solution(stdin: str) -> str:
    n, m = map(int, stdin.split())
    a = [list(map(int, stdin.split())) for _ in range(n)]

    for i in range(m):
        for j in range(n):
            # 第 j 个元素的右边的没有定义，所以每个元素的右边给一个初始值
            a[j][(j + 1) % n] = i + 1
    return str(min(
        sum(a[i][j] for j in range(n)) - min(a[i][j] for j in range(n)) - n * i
        for i in range(m)
    ))
